import React from 'react';
import {Jumbotron} from 'react-bootstrap';


export default class Welcome extends React.Component{
	render(){
		return(
			<div>

				<Jumbotron>
			      <h1> Welcome to the Database Manage System!</h1>
			      <p>
			      Construction under progress!
			      </p>

			      </Jumbotron>
			</div>
		);
	}
}
